import './style.css';
import React from 'react';
import {Grid, IconButton} from '@mui/material';
import RecordsCount from '../Manage/RecordsCount';
import LoadDataModal from '../Manage/LoadDataModal';
import { useParams, useLocation } from "react-router-dom";
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';
import WhiteContainer from '../../components/WhiteContainer/WhiteContainer';


function SystemPage(props) {
    const { id } = useParams();
    const {state} = useLocation();

    return (
        <div>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <WhiteContainer>
                        <div className='back-btn-container'>
                            <IconButton onClick={() => console.log(`props?.history?.push(path)`)}>
                                <ArrowForwardIcon/>
                            </IconButton>
                        </div>
                        <div className='lead-title-container'>
                            <div className='lead-title'>{`מערכת ${state.name}`}</div>
                        </div>
                        {/* <LeadRecordingsModal phone={userData?.leadData?.fields?.phone}/> */}
                        {/* <LeadAdditionalDataModal userData={userData} statusCode={userData?.leadData?.statusCode}/> */}
                    </WhiteContainer>
                </Grid>
                <Grid item xs={12} sm={6}>
                    <WhiteContainer style={{minHeight : '70vh', maxHeight : '70vh', overflow : 'auto'}}>
                        <Grid container>
                            <Grid item xs={12}>
                                <RecordsCount systemId={id}/>
                            </Grid>
                            <Grid item xs={12}>
                                תותח
                            </Grid>
                        </Grid>
                    </WhiteContainer>
                </Grid>
                <Grid item xs={12} sm={6}>
                <WhiteContainer>
                    סטטיסטיקות
                    {/* <NotesContainer leadId={props.match.params.id} userData={userData}/> */}
                </WhiteContainer>
                </Grid>
            </Grid>
            <LoadDataModal/>
        </div>
    );
}

export default SystemPage;
